import React from "react";
import { Route, Link, BrowserRouter as Router } from 'react-router-dom';
import "./HorizontalneListe.css"

class HorizontalnaLista extends React.Component {
  render() {
    return (
      <Router>
        <ul>
          <li><Link to={this.props.prviLink}>{this.props.prvi}</Link></li>
          <li><Link to={this.props.drugiLink}>{this.props.drugi}</Link></li>
          <li><Link to={this.props.treciLink}>{this.props.treci}</Link></li>
          <li><Link to={this.props.cetvrtiLink}>{this.props.cetvrti}</Link></li>
        </ul>
      </Router>

    );
  }

}

export default HorizontalnaLista;
